// Function to get the fastest gas price for the transcation
async function getEtherGasPrice(){
    let res = await axios.get('https://ethgasstation.info/json/ethgasAPI.json')

    return (res.data.gasPriceRange[res.data.fastest] * 1000000000000) 
}

// Function checks if the given address is valid ethereum address
function isAddress(address){
    return (web3.utils.isAddress(address))
}


